import React from "react";

function CreateArea(props) {
  return (
    <div>
      <form>
        <input
          name="title"
          placeholder="Title"
          onChange={props.handleNewNote}
        />
        <textarea
          name="content"
          placeholder="Take a note..."
          rows="3"
          onChange={props.handleNewNote}
        />
        <button onClick={ () => {

          props.addItem;

        }}>Add</button>
      </form>
    </div>
  );
}

export default CreateArea;
